import React from "react";

function Deck({ name, description }) {
    return (
        <div class="card">
            <div class="card-body">
                <h2>{name}</h2>
                {description}
                <a href="/" class="btn btn-secondary">View</a>
            </div>
        </div>
    );
}

export default Deck;
